                // Get the expected sorted data, given the data to be sorted and 
                // the expected index table.
                double[] GetExpectedData(double[] data, int[] expectedIndexTable)
                {
                    double[] expectedData = new double[data.Length];

                    for (int i = 0; i < data.Length; i++)
                    {
                        expectedData[i] = data[expectedIndexTable[i]];
                    }

                    return expectedData;
                }

                // Sort massive double data in ascending order
                {
                    var data = GetData();

                    SortDirection sortDirection = SortDirection.Descending;

                    int[] expectedIndexTable = GetExpectedIndexTable(sortDirection);

                    double[] expectedData = GetExpectedData(data, expectedIndexTable);

                    SortHelper.Sort(data, sortDirection);

                    DoubleArrayAssert.AreEqual(expectedData, data, DoubleMatrixTest.Accuracy);
                }

                // Sort massive double data in descending order
                {
                    var data = GetData();

                    SortDirection sortDirection = SortDirection.Ascending;

                    int[] expectedIndexTable = GetExpectedIndexTable(sortDirection);

                    double[] expectedData = GetExpectedData(data, expectedIndexTable);

                    SortHelper.Sort(data, sortDirection);

                    DoubleArrayAssert.AreEqual(expectedData, data, DoubleMatrixTest.Accuracy);
                }

                // Sort massive double data in ascending order and return a corresponding index table
                {
                    var data = GetData();

                    SortDirection sortDirection = SortDirection.Descending;

                    int[] expectedIndexTable = GetExpectedIndexTable(sortDirection);

                    double[] expectedData = GetExpectedData(data, expectedIndexTable);

                    SortHelper.Sort(data, sortDirection, out int[] actualIndexTable);

                    DoubleArrayAssert.AreEqual(expectedData, data, DoubleMatrixTest.Accuracy);
                    ArrayAssert<int>.AreEqual(expectedIndexTable, actualIndexTable);
                }

                // Sort massive double data in descending order and return a corresponding index table
                {
                    var data = GetData();

                    SortDirection sortDirection = SortDirection.Ascending;

                    int[] expectedIndexTable = GetExpectedIndexTable(sortDirection);

                    double[] expectedData = GetExpectedData(data, expectedIndexTable);

                    SortHelper.Sort(data, sortDirection, out int[] actualIndexTable);

                    DoubleArrayAssert.AreEqual(expectedData, data, DoubleMatrixTest.Accuracy);
                    ArrayAssert<int>.AreEqual(expectedIndexTable, actualIndexTable);
                }
            }
